const Index = () => (
  <div className="index-container">
    <h1>R E N A</h1>
    <p>I t ' s &nbsp;&nbsp;&nbsp;&nbsp;J u s t &nbsp;&nbsp;&nbsp;&nbsp;A r t</p>
    <style jsx>{
      `
      * {
        font-family: Roboto;
        box-sizing: border-box;

      }
    body {
      background-color: #071a24;

    }
     h1, p {
       color: #f5f1d0
     }
     h1 {
       font-size: 3rem;
       margin: 0rem
     }
     p {
       margin-top: 0
     }
      .index-container {
        display: flex;
        flex-direction: column;
        align-items: center;
      }
      `
    }
    </style>
  </div>
)

export default Index
